import { BrowserRouter, Routes, Route } from "react-router-dom";
import { About } from './About'
import { Home } from './Home'
import { Store } from './Store'
import LinkButton from "./LinkButton";


function RouteSwitch(props){

    const {addItemToCart, filterItems, items, types} = props;

    return (
        <BrowserRouter>

            <LinkButton link = '/' text = 'Home'></LinkButton>
            <LinkButton link = '/store' text = 'Store'></LinkButton>
            <LinkButton link = '/about' text = 'About'></LinkButton>

            <Routes>
                <Route path = '/' element = {<Home></Home>}></Route>
                <Route path = '/store' element = {<Store items = {items} addItemToCart = {addItemToCart} filterItems = {filterItems} types = {types}></Store>}></Route>
                <Route path = 'about' element = {<About></About>}></Route>
            </Routes>
        </BrowserRouter>
    )       
}

export {RouteSwitch}
